import React from 'react';
import { useHistory, useEffect, useSate } from 'react-router-dom';

const Profile = ({ user }) => {
  const history = useHistory();
  if(!user.username) history.push('/');

  return (
    <div>
      <h2>Profile</h2>  
    </div>  
  );
};

export default Profile;
